% y = [Vd, Vq, Ifd, \omega]
% u = [Id, Iq, Efd]
% \theta = [H D Tpd0 Tppd0 Tppq0 Xd Ra Xppd Xpd Xl Xq Xpq Xppq]:

A = [-(Dt+P_0)/(2*H)   -Ks/(2*H)    0               0           0;
    omega                   0       0               0           0;
    0                       0       (SE+1+K1)/Tpd0  K1/Tpd0     0;
    0                       0       1/Tppd0         -1/Tppd0    0;
    0                       0       0               0           -1/Tppq0];

