     0                                      0               0;
     (K1*(Xpd-Xl)-(Xd-Xpd))/Tpd0            0               1/Tpd0;
     -(Xpd-Xl)/Tppd0                        0               0;
     0                                     (Xq-Xppq)/Tppq0  0;];

C = [0      0       0           0       1
     0      0       K3          K4      0;
     0      0       -(K1+SE+1) -K1      0;
     0      1       0           0       0;];

D = [-Xppd                -Ra     0;
