Vr = -(sind(delta)*ud_0 + cosd(delta)*uq_0)
Vi = -(-cosd(delta)*ud_0 + sind(delta)*uq_0)


% Translate P and Q to Ir and Ii
% -P = VrIr + ViIi
% -Q = ViIr - VrIi
PQ = -([Vr Vi; Vi -Vr]); %  -([Vr Vi; Vi -Vr])*[Ir;Ii]

IdIq = -(([sind(delta), cosd(delta); -cosd(delta), sind(delta)])); % Translate Ir and Ii to Id and Iq 



u_ch = inv(PQ*IdIq); % change the input from [Id; Iq]; to [P;Q];

C1 = [sin(delta), cos(delta); -cos(delta), sin(delta)]*C(1:2,:);
C2 = sqrt(C1(1,:).^2+C1(2,:).^2);
C = [C2;C(3:4,:)];

B1 = [B(2:5,1:2) * -u_ch];
B = [-1/(2*H) 0 0;  %% Electric power from swing equations
    B1, B(2:5,3)];  %% Translation from the IqId inputs
D1 = [D(:,1:2) * u_ch];
D = [D1, D(:,3)];

